      "turismdescription" : "El alojamiento rural Aitzeder está situado en un privilegiado enclave de la comarca guipuzcoana del Goierri. En la Vía de Bayona del Camino de Santiago, desde el establecimiento se puede disfrutar de espléndidas vistas de las sierras de Aralar y Aizkorri. <br/><br/>Con excelentes comunicaciones, Aitzeder se encuentra a 9 km de Beasain,  a 50 km de San Sebastián y a menos de una hora de Bilbao o Vitoria-Gasteiz. <br/><br/>Las confortables habitaciones cuentan con baño completo con ducha, televisión, conexión WiFi gratuita y posibilidad de cama supletoria.<br/><br/>Además, los huéspedes disponen de una zona común con comedor. Ideal para todos aquellos que vienen en viaje turístico por la zona, para los que quieren hacer un alto en su etapa del Camino o para quien viene a trabajar en la zona.",
