      "documentname" : "CASTILLO EL COLLADO",
      "turismdescription" : "Este precioso hotel con encanto ocupa un castillo de excepcional belleza, que  data del siglo XX (1900), enclavado en uno de los lugares mas privilegiados de la villa de Laguardia. El primer propietario, el Sr.Tapia, fue un sensible hacendado de la zona fundador de la conocida marca de jabones ¿Chimbo¿. Lo construyó con las piedras originales del antiguo cuartel del siglo XII, llamado \"el Cuartel del  Rey¿.<br/><br/>Como homenaje al mágico universo del fabulista Samaniego, el Castillo El Collado nos ofrece la posibilidad de entrar en ese universo gracias a diez  habitaciones decoradas con un gusto exquisito y con unas vistas maravillosas. Las alcobas, diferentes en decoración, han sido equipadas y ambientadas hasta el último detalle. Se ha mantenido en lo posible el estilo y los objetos de la decoración original. Los techos con sus artesanados parecen de ensueño.<br/> <br/>En la recepción del Hotel, una capilla con un retablo del siglo del XVII en pan de plata y pan de oro, sorprende gratamente a visitantes.<br/><br/>Para los ratos de ocio dispone de un área de juegos y un bar, situado en la planta principal, flanqueado por unas preciosas vidrieras, de estilo modernista.",
