      "documentname" : "EA-ASTEI",
      "turismdescription" : "Además de la <a href=\"http://turismo.euskadi.net/es/alojamientos/casa-rural-ea-astei/x65-12375/es/\"target=\"_blank\">casa rural</a>, Ea Astei, en un enclave natural privilegiado, en la Reserva de la Biosfera de Urdaibai, cuenta con dos casas: Okana y Vita. La primera de ellas de 150 metros cuadrados, dispone de una cocina totalmente equipada, un amplio salón acristalado, jardín, una terraza y dos habitaciones, ambas con baño y una de ellas con vestidor. En cuanto a la denominada Casa Vita, se trata del primer alojamiento construido en Euskadi que genera su propia energía ecológica. En el edificio, de una planta de más de 170 metros cuadrados, destacan sus acristaladas terrazas con vistas al bosque, la cocina, el amplio salón de 80 metros cuadrados y los dormitorios, cada uno con su baño.",
