      "documentname" : "EA ASTEI",
      "turismdescription" : "Ea Astei es un caserío del siglo XVII, situado en una zona de gran belleza paisajística, cerca de la Reserva de la Biosfera de Urdaibai, a tan sólo 3 kilómetros del puerto de Elantxobe y a 5 kilómetros de las magníficas playas de Laida, Laga y Ea. La casa dispone de un cuidado y extenso jardín, con unas magníficas vistas al pueblo de Ereño, su iglesia y sus canteras. Los clientes disponen de 2 pérgolas de madera y mobiliario de jardín. El alojamiento cuenta con instalaciones de piscina climatizada, spa, sauna y gimnasio, para la puesta en forma y reducción del estrés. <br/><br/>Ea Astei dispone de 3 unidades de alojamiento totalmente equipadas. Así, <strong>Etxeaundi</strong>, una casa para 4 personas, es la que cuenta con los espacios comunes más amplios  en caso de que los clientes escogieran esta casa, sería el sitio ideal para organizar reuniones, comer o cenar en grupo, charlar¿ Por otra parte, <strong>Sabai</strong> es un alojamiento para 2 o 4 personas, una espléndida casa en un espacio abierto y diáfano con una fantástica estructura del caserío a la vista. Finalmente, <strong>Garaixe</strong> es un hórreo acondicionado que permite al huésped disfrutar de momentos inolvidables y placenteros.",
