      "documentname" : "PERLAKUA SAKA",
      "turismdescription" : "El Caserío Perlakua es una antigua ganadería edificada en 1897, ubicada en las campas del alto de Itziar, en un paraje natural y con unas preciosas vistas al mar y al pueblo de Deba. Se encuentra a tan solo 3 km de la costa y las playas y a media hora de la capital guipuzcoana. <br/><br/>Las habitaciones están restauradas y decoradas en consonancia con la edad del caserío, con sutiles toques de modernidad pero sin perder su esencia y encanto rural. Diferentes y acogedoras, todas ellas cuentan con baño privado, TV, calefacción y vistas al mar o a la montaña.<br/><br/>Además, el establecimiento cuenta con un restaurante, donde es posible disfrutar de la gastronomía típica y casera donde destacan sus productos cárnicos locales.<br/><br/>Las actividades de ocio que ofrece el agroturismo y su entorno son numerosas: bosques frondosos, rutas para hacer a pie, vistas panorámicas y playas espectaculares.",
